function parseParam(params) {
	var result = {};

	params.split('&').forEach(function(pair){
		var kv = pair.split('=');
		
		if (kv.length !== 2) {
			return;
		}

		result[kv[0]] = decodeURIComponent(kv[1].replace(/\+/g, ' '));
	});

	return result;
}
